import React from "react";
import CommonHeader from "./CommonHeader";
import Title from "./Title";
import Footer from "./Footer";

const ContactUs=()=>{
    return <React.Fragment>
        <CommonHeader />
        <Title/>
        <form>
            <label>Name</label>
            <input type="text"/>
            <label>Email Id</label>
            <input type="email"/>
            <label>Phone Number</label>
            <input type="number"/>
        </form>
        <Footer/>
    </React.Fragment>
}

export default ContactUs;
